const INPUT = `



`;

function processInput(input) {
    return input.split('\n').map(line => line.split(''));
}

function processLine(line, startingSpot) {
    return line.reduce(lineReducer, startingSpot);
}

function lineReducer(startingSpot, instruction) {
    switch(instruction) {
        case 'U':
            if (startingSpot - 3 > 0) return startingSpot - 3;
            break;
        case 'R':
            if (startingSpot % 3 !== 0) return startingSpot + 1;
            break;
        case 'D':
            if (startingSpot + 3 < 10) return startingSpot + 3;
            break;
        case 'L':
            if (startingSpot % 3 !== 1) return startingSpot - 1;
            break;
    }
    return startingSpot;
}

function findKeyCode(input) {
    const lines = processInput(input);
    let startingSpot = 5;
    const code = lines.map((line) => {
        startingSpot = processLine(line, startingSpot);
        return startingSpot;
    });
    return code.join('');
}

console.log(findKeyCode(INPUT));